import React from 'react';
import { Button, Card, Container, Row, Col } from 'react-bootstrap';
import './About.css';

import jenaVoz from './Jena_Vozzella.jpg';
import chrisInm from './Chris_Inman.jpg';
// import cathyInm from './Cathy_Inman.jpg';
import loriArm from './Lori_Armstrong.png';
// import lauraRic from './Laura_Ricketts.jpg';
import alfredVoz from './Alfred_Vozzella.png';
import paigeEng from './Paige_Engle.jpg';

import Header from '../../components/Header/Header.js';
import Footer from '../../components/Footer/Footer.js';

function About()
{
    return (
        <div className="About">
            <Container fluid>
                <Header />
                <h1>Meet the team</h1>
                <Row className="About-team-one">
                    <Col md={2} style={{ backgroundColor: "#F60C5B" }}>
                        <img src={jenaVoz} alt="Jena Vozzella" width="144" height="258" />
                        <h3></h3>
                    </Col>
                    <Col md={2} style={{ backgroundColor: "#4C0CF6" }}>
                        <img src={chrisInm} alt="Chris Inman" width="144" height="258" />
                    </Col>
                    <Col md={2} style={{ backgroundColor: "#F60C5B" }}>
                        <img src={chrisInm} alt="Chris Inman" width="144" height="258" />
                    </Col>
                    <Col md={2} style={{ backgroundColor: "#4C0CF6" }}>
                        <img src={loriArm} alt="Lori Armstrong" width="150" height="150" />
                    </Col>
                </Row>
                <Row className="About-team-two">
                    <Col md={2} style={{ backgroundColor: "#4C0CF6" }}>
                        <img src={alfredVoz} alt="Alfred Vozzella" width="200" height="200"/>
                    </Col>
                    <Col md={2} style={{ backgroundColor: "#F60C5B" }}>
                        <img src={alfredVoz} alt="Alfred Vozzella" width="200" height="200"/>
                    </Col>
                    <Col md={2} style={{ backgroundColor: "#4C0CF6" }}>
                        <img src={paigeEng} alt="Paige Engle" width="250" height="250" />
                    </Col>
                </Row>
                <Row className="About-statement">
                    <div className="Statement-body">
                        <p>
                            Every Family should have the right to bury their child and it should not cause Heartache - in the most difficult times to make those arrangements. We realize that very few families would find the same resources that were made available to us. We wanted to provide the same level of support for others and could only do so by creating the Little Souls at Rest Foundation.
                        </p>
                    </div>
                </Row>
                <Footer />
            </Container>
        </div>
    );
}

export default About;
